(2, 'Distance Sales Agreement', 'distance-sales-agreement', '<p><strong>PARTIES</strong></p>\r\n<p>This Contract is entered into between;</p>\r\n<p><strong>SELLER</strong></p>\r\n<p>Title :</p>\r\n<p>Mersis Number :</p>\r\n<p><strong>Address </strong></p>\r\n<p>E-mail :</p>\r\n<p>Phone Number :</p>\r\n<p><strong>PURCHASER</strong></p>\r\n<p>Name Surname/Title :</p>\r\n<p>Address:</p>\r\n<p>E-mail :</p>\r\n<p>Phone number :</p>\r\n<p>as of ../../&hellip; upon the acceptance and confirmation that were provided over the online platform.</p>\r\n<p>(Hereinafter individually referred to as &lsquo;&lsquo;Party&rsquo;&rsquo; and collectively a &lsquo;&lsquo;Parties&rsquo;&rsquo;.)</p>\r\n<p>For purposes of this Contract, the following terms shall have the following meanings:</p>\r\n<p><strong>MINISTRY : </strong>Ministry of Trade,</p>\r\n<p><strong>LAW : </strong>Law on Consumer Protection No. 6502,</p>\r\n<p><strong>REGULATION :</strong> Regulation on Distance Selling Contracts dated 27.11.2014 and published on</p>\r\n<p><strong>DPL :</strong> Personal Data Protection Law No. 6698,</p>\r\n<p><strong>PRODUCT :</strong> Goods to be sold under the web-site of the Mall of Turkey subject to the selling and purchasing processes governed under this Contract,</p>\r\n<p><strong>SELLER :</strong> The company that offers goods to the consumers within the context of its commercial or professional activities,</p>\r\n<p><strong>PURCHASER : </strong>Real or legal person who acquires, uses or benefits from a good or service for non-commercial or non-professional purposes,</p>\r\n<p><strong>WEBSITE : </strong>Seller&rsquo;s website,</p>\r\n<p><strong>ORDERER : </strong>Real or legal person who orders a good or service through Seller&rsquo;s website,</p>\r\n<p><strong>PARTIES :</strong> The Seller and the Purchaser,</p>\r\n<p><strong>AGREEMENT : </strong>The distance selling contract that Seller and the Purchaser concludes.</p>\r\n<p><strong>SUBJECT OF THE CONTRACT</strong></p>\r\n<p style=\"text-align: center;\"><strong>3.1</strong></p>\r\n<p>The subject of this Agreement is to set the rights and obligations of the Parties with regards to sale and delivery of products (\"Product/Products\"), for which the qualifications and prices are mentioned in the Contract and that the Customer orders through electronic platforms from the Seller\'s website <a href=\"https://shop.ltbjeans.com/\">https://www.mallofturkeya.com</a> (&ldquo;Website&rdquo;), in accordance with the provisions of the Law on Consumer Protection No. 6502 (\"Law\") and the Regulation on Distance Contracts dated 27.11.2014 (\"Regulation\").</p>\r\n<p style=\"text-align: center;\"><strong>3.2</strong></p>\r\n<p>The prices listed and announced on the Website are the sales prices. The prices announced on the Website are valid until they are updated or changed. The prices that are announced for a limited term are valid until the end of the specified term.</p>\r\n<p><strong>THE PRODUCT OR SERVICE THAT THE CONTRACT COVERS, PAYMENT AND DELIVERY</strong></p>\r\n<p>&nbsp;</p>\r\n<p>The type, quantity, brand, model, color and sale price (including VAT) of the Product or Products that constitute the subject of this Agreement are as follows:</p>\r\n<p>&nbsp;</p>\r\n<p>Method of Payment :</p>\r\n<p>Delivery Address :</p>\r\n<p>Recipient&rsquo;s Name :</p>\r\n<p>Billing Address :</p>\r\n<p><strong>RIGHTS, OBLIGATIONS AND STATEMENTS OF THE PARTIES</strong></p>\r\n<p>The Purchaser acknowledges, undertakes, and confirms that she/he has read and in electronic format approved the preliminary information form consisting of following information and that she/he has been informed accurately and fully about the following information; Product&rsquo;s qualifications and price (including VAT), method of payment, delivery, delivery cost, right of withdrawal, Purchaser&rsquo;s obligation to pay for the costs caused by usage of right of withdrawal, Seller&rsquo;s title, address and contact information.</p>\r\n<p style=\"text-align: center;\"><strong>5.2</strong></p>\r\n<p>The Purchaser, acknowledges, undertakes and confirms that by accepting the terms of this Contract that she/he has been informed about the following preliminary information and that she/he approved them in electronic format and then ordered the Product and/or Products; Product&rsquo;s qualifications and price (including VAT), method of payment, terms of delivery, all other preliminary information and right of withdrawal.</p>\r\n<p style=\"text-align: center;\"><strong>5.3</strong></p>\r\n<p>The delivery of the Product or Products will be made as soon as possible upon receiving the sales price on the condition that the Product or Products are in stock. The Purchaser shall be able to use one of her/his rights listed on Article 5.14 of this Contract if the stocks are not available for the ordered Product. The Seller acknowledges, undertakes, and confirms that it will, in no more than 30 days, depending on the distance of the Purchasers place of settlement, deliver the Product or Products to the delivery address of the Purchaser.</p>\r\n<p style=\"text-align: center;\"><strong>5.4</strong></p>\r\n<p>The Seller acknowledges, undertakes and confirms that it is responsible for delivering the Product or Products subject to this Contract in full, in accordance with the qualifications specified in the Contract, with the certificate of warranty and user guide and all other necessary documents and information.</p>\r\n<p style=\"text-align: center;\"><strong>5.5</strong></p>\r\n<p>If the Seller has declared that the delivery cost of the Purchaser who exceed the total amount specified on the Website will be covered by the Seller or that it will make free delivery within a campaign, the delivery cost belongs to the Seller. However, there isn&rsquo;t any statement regarding free delivery, the delivery costs will be covered by the Purchaser.</p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\"><strong>5.6</strong></p>\r\n<p>The Customer shall check the Product or Products subject to the Contract at the time of delivery but before receiving them and he/she will not accept them if crushed, broken, torn or somehow damaged or defected.</p>\r\n<p style=\"text-align: center;\"><strong>5.7</strong></p>\r\n<p>The Purchaser acknowledges, confirms and undertakes that the Product or Products received from the cargo company are delivered to him in full, undamaged and without a defect. It is Purchaser&rsquo;s responsibility to keep the products safe after the delivery. If the right of withdrawal will be used then the Product or Products should not be used. The invoice must also be returned with the Product or Products. The Seller reserves the right to not accept the return of the Products or Products if the Products or Products returned by using the right of withdrawal have been used.</p>\r\n<p style=\"text-align: center;\"><strong>5.8</strong></p>\r\n<p>The Purchaser acknowledges, confirms and undertakes that if the bank or financial institution concerned does not pay the Seller the price of the Products or Products due to the unfair or unlawful use of the Purchaser\'s credit card by unauthorized persons after the delivery of the Product or Products, the Purchaser is obliged to send the Product or Products to the Seller within 3 (Three) days, in which case delivery cost belongs to the Purchaser.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p style=\"text-align: center;\"><strong>5.9. </strong></p>\r\n<p>If for any reason the Seller is not paid for the Products or Products, or that the payment cancelled in the bank records, the seller shall be free of its obligation to deliver the Product or Products.</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p style=\"text-align: center;\"><strong>5.10</strong></p>\r\n<p>The Parties acknowledge, confirm and undertake that if Product or Products are asked to be delivered to a third person other than the Purchaser, the Seller is not responsible for the occasions where the third person does not accept the delivery.</p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\"><strong>5.10</strong></p>\r\n<p>The Seller may provide other Product or Products of equal quality and price to the Purchaser before the period determined for performing its duties in the Contract expires if there is a fair justification. If the Seller believes that performing its duties have become impossible, she/he shall notify the Purchaser before the period for performing its duties in the Contract expires. The price paid and the documents, if any, shall be returned to the Purchaser within 10 (Ten) working days.</p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\"><strong>5.12</strong></p>\r\n<p>The Seller shall not be held responsible if the ordered Product or Products cannot be delivered to the delivery address of the Purchaser specified in this Contract due to any problems that the delivery company will encounter during the delivery of the Product or Products to the Purchaser.</p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\"><strong>5.13</strong></p>\r\n<p>If the Seller cannot deliver the Product or Products in cases where the delivery of the Product or Products has become impossible, it shall notify the Purchaser before the period for performing its duties under the Contract expires and can provide the Purchaser with other Product or Products of equal quality and value.</p>\r\n<p style=\"text-align: center;\"><strong>5.16</strong></p>\r\n<p>For Purchaser\'s credit card payments, the amount paid for the Product or Products is refunded to the relevant bank within 7 days after the order is canceled by the Purchaser. The reflection of this amount on Purchaser\'s bank account after the refund is entirely related to the bank\'s transaction processes and it is not possible for Seller to intervene in any way regarding this issue.</p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\"><strong>5.17</strong></p>\r\n<p>The vouchers -if any- that Purchaser has for use on the Website can only be used once for each order. If used 2 or more times, the order will be canceled, and the amount paid will be refunded.</p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\"><strong>5.18</strong></p>\r\n<p>Seller reserves the right to stop the order where it deems necessary when the information provided by the Customer are not accurate. In cases where the Seller detects problems with the order, the Seller is entitled to freeze the order for 15 (fifteen) days, if it cannot contact with the Purchaser through the phone number, e-mail and mail addresses provided by the Purchaser for. The Purchaser is expected to contact the Seller during this period. If no response is received from the Customer during this period, Seller cancels the order to avoid possible damages for both parties. If the Purchaser places an order with payment through wire transfer for two consecutive times and does not make the payment, the Seller reserves the right to cancel that Purchaser\'s other orders placed with payment through wire transfer. If the Purchaser refuses the delivery for her/his orders placed with payment on delivery, the Seller is entitled to cancel Purchaser&rsquo;s other orders placed with payment on delivery.</p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\"><strong>5.19</strong></p>\r\n<p>The Product or Products covered under a campaign can only be exchanged with Product or Products under the same campaign. In case the Product or Products under a campaign are asked to be replaced with Product or Products that are not covered under the same campaign, the Product or Products in the possession of Purchaser will be evaluated with their season price and the remaining balance will only be able to be used for the categories that are not covered under the campaign.</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p style=\"text-align: center;\"><strong>5.20</strong></p>\r\n<p>In the process of returning the Product/Products covered under a campaign, it is mandatory for Purchaser to send all the Product/Products he purchased from that campaign to the Seller. If only one product is sent to Seller for the return of Product/Products covered under the campaign; the Product or Products that are not sent will be evaluated with their season price and the remaining balance will be refunded accordingly.</p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\"><strong>5.21</strong></p>\r\n<p>Purchaser who violates the provisions of this Contract shall be personally responsible for this violation in terms of both civil and criminal law. The Seller shall not be liable for the legal and criminal consequences of these violations. In addition, Seller reserves the rights to file a lawsuit and complain in any way due to this violation.</p>\r\n<p><strong>RIGHT OF WITHDRAWAL AND CHANGING</strong></p>\r\n<p style=\"text-align: center;\"><strong>6.1</strong></p>\r\n<p>The Purchaser, without any reason and within 14 (Fourteen) days upon the delivery of the Product/Products to the delivery address specified in this Contract, may exercise the right of withdrawal, or change the Product/Products she/he bought.</p>\r\n<p style=\"text-align: center;\"><strong>6.2</strong></p>\r\n<p>In order to exercise the right of withdrawal, it is imperative that the Seller is notified by phone or e-mail within the 14 (Fourteen) days period and that the Product/Products that are intended to be returned must not have been used as explained in the provisions of Article 6 of this Agreement and must be in a form that the Seller may resell. If the right of withdrawal is exercised:</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p style=\"text-align: center;\"><strong>6.3</strong></p>\r\n<p>The invoice of the Products/Products delivered to the delivery address specified by the Purchaser in this Contract must be delivered to the Seller in full and undamaged, together with the return form, the box, packaging and the standard accessories of the Product/Products if any. (If the invoice of the Product/Products to be returned is corporate invoice, it must be sent with the return invoice issued by the purchaser institution when returning. The orders for which the invoice is issued for purchaser institutions, cannot be returned without a return invoice issued by the purchaser institution)</p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\"><strong>6.4</strong></p>\r\n<p>Within 10 (Ten) working days following the arrival of the items listed in Article 6.2 to the Seller, the amount paid for the Product/Products will be returned to the Purchaser or Product/Products will be changed.</p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\"><strong>6.5</strong></p>\r\n<p>All delivery costs of the Product/Products returned for any reason during the specified period, including delivery to the Purchaser, will be covered by the Seller. In case of change, the delivery costs related to the first change will be covered by the Seller and the second change cost will be covered by the Customer if the same Product/Products are changed twice. The same product cannot be changed more than 2 times within the same order. The service fee charged by the cargo company within the payment made for Product/Products in connection with the orders placed with payment on delivery is not refundable.</p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\"><strong>6.6</strong></p>\r\n<p>When returning the Product/Products to the Seller, the original invoice submitted to the Purchaser at the time of delivery must also be returned to the Seller, and if the invoice is not sent to the Seller with the Product/Products or within 5 (Five) days of the shipment of the Products/Products at the latest, the refund will not be made, and the Product/Products will be sent back to the Purchaser in the same way as a counter-payment.</p>\r\n<p style=\"text-align: center;\"><strong>6.7</strong></p>\r\n<p>The Purchaser will write &lsquo;&lsquo;This is a return invoice&rsquo;&rsquo; on the invoice that will be returned and sign it.</p>\r\n<p><strong>PROTECTION OF PERSONAL DATA</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p style=\"text-align: center;\"><strong>7.1</strong></p>\r\n<p>The Seller acknowledges, confirms and undertakes that it will securely store any personal data transferred to it by the Purchaser under the Contract. It is Seller\'s own legal responsibility to carry out any data processing activities other than this transfer purpose such as fulfilling the obligations stipulated in the applicable legislation for explicit consent, clarification, etc. if necessary.</p>\r\n<p style=\"text-align: center;\"><strong>7.2</strong></p>\r\n<p>The Parties acknowledge and confirm that they obtained, processed, stored and transferred the personal data they will transfer to each other in compliance with the procedures and principles in the DPL, the relevant regulatory actions, and the provisions on the protection of personal data contained in the relevant legislation. In addition, the Parties acknowledge and confirm that the owners of the relevant personal data are clearly informed in accordance with the procedures and principles contained in the DPL, the relevant regulatory actions, the provisions on the protection of personal data contained in the relevant legislation, and that the explicit consent of the data owners is obtained if required by the circumstances.</p>\r\n<ol>\r\n<li><strong> </strong><strong>PRODUCTS THAT CANNOT BE USED WITH THE RIGHT OF WITHDRAWAL</strong></li>\r\n</ol>\r\n<p>For the Products whose protective elements such as packaging, tape, seal, package have been opened after deliver yor Products that are not suitable for return in terms of health and hygiene shall not be accepted for right of withdrawal; &nbsp;</p>\r\n<p><strong>GOVERNING LAW AND JURISDICTION</strong></p>\r\n<p style=\"text-align: center;\"><strong>9.1</strong></p>\r\n<p>This agreement shall be governed by Turkish Law and any disputes that may arise out of this Agreement shall be settled by the Courts and Execution Offices of Istanbul.</p>\r\n<p style=\"text-align: center;\"><strong>9.2</strong></p>\r\n<p>In this respect, Consumer Arbitration Committees and Consumer Courts and Enforcement Offices in the Customer\'s settlement are authorized up to the value announced by the Ministry of Trade under Turkish Law.</p>\r\n<p><strong>MISCELLANEOUS</strong></p>\r\n<p style=\"text-align: center;\"><strong>10.1</strong></p>\r\n<p>If any provision or part of this Agreement is held invalid under any law, by any legal or governmental authority or court, such provision shall not affect the validity of the remaining provisions.</p>\r\n<p style=\"text-align: center;\"><strong>10.2</strong></p>\r\n<p>Parties accept that the above-specified addresses are their legal notification addresses.&nbsp; Unless any address changes are notified to the other party in writing, the notices served to the above addresses shall be legally binding.</p>\r\n<p style=\"text-align: center;\"><strong>10.3</strong></p>\r\n<p>This Agreement has been confirmed by the duly authorized representatives of the Parties via <a href=\"http://www.malofturkeya.com.tr\">www.malofturkeya.com.tr</a></p>\r\n<p>&nbsp;</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p>&nbsp;</p>', NULL, NULL, NULL, '2021-07-30 16:59:36', '2021-07-30 16:59:36'),
(3, 'Privacy Policy', 'privacy-policy', '<p style=\"text-align: center;\"><strong>PRIVACY POLICY </strong></p>\r\n<p>In this Privacy Policy, managed and operated by the Mall of Turkey Elektronik Hizmetler Anonim Şirketi (&ldquo;Mall of Turkey/Service Provider&rdquo;) for Mall of Turkey to fulfil its obligation to inform in accordance with the Law No. 6698 on Protection of Personal Data (&ldquo;Law&rdquo;); while collecting and using your personal data to complete the time spent during the visit and service process of the site named www.mallofturkeya.com.tr (&ldquo;Site&rdquo;), which was established to meet the needs of its customers about the products sold in Turkey followed by Mall of Turkey are explained. Mall of Turkey adopts this Privacy Policy in terms of privacy, usage and other related information shared by members on the Site.</p>\r\n<p>This Privacy Policy and Personal Data text has been prepared following the &ldquo;Notification on the Procedures and Principles to be Followed in Fulfilling the Obligation to Inform&rdquo; dated 10 March 2018, which came into force within the scope of the Law. Mall of Turkey reserves the right to update the clarification text, which it has put into practice following the Law on the Protection of Personal Data.</p>\r\n<p><strong>WHAT KIND OF PERSONAL DATA DO WE PROCESS?</strong></p>\r\n<p>When you use Mall of Turkey web-site, we collect the following information about you and your use of our services from various sources. It is important to note that Mall of Turkey shall fulfil the obligation to inform and if necessary, the explicit consent for any personal data processing procedure below and beyond the scope of your visit to this website in accordance with the Law.</p>\r\n<ul>\r\n<li><strong>Registration Information: </strong>To benefit from Mall of Turkey services, you must be a member of Mall of Turkey. To register, you must enter your username, surname, nationality, password, e-mail address, gender, residence address. If you wish to register with third party accounts (such as Google or Facebook accounts), we will register the information that the third-party account belongs to you during this registration.</li>\r\n<li><strong>Invoice Information: </strong>When you are paying to Mall of Turkey, you shall provide details of invoices such as name, address, phone number, e-mail address, commercial name, tax office and tax number information and financial information of the payment type you select (such as credit card number, expiration date, bank account number). When you purchase on our site, you accept that your financial information shall be transferred to third parties (banks, credit card companies, etc.) required to carry out your transaction. The information to be shared includes all the necessary financial information such as credit card number, expiration date, CVV2. All your credit card and personal data are encrypted with SSL Secure System, which is the internet security standard as 128 mbit. In this manner, your data is prevented from being captured in any form of undesirable people or institutions during their circulation on the internet.</li>\r\n<li><strong>Service Data That You Want To Be Evaluated or Reviewed: </strong>The information you have entered regarding the service you want to supply or receive through Mall of Turkey is registered in the Mall of Turkey substructure for evaluation and used to provide you better service in later stages.</li>\r\n<li><strong>Other Data You Appealing Share: </strong>We shall process personal information or data that you share in different contexts.</li>\r\n<li><strong>Usage Data: </strong>Usage data is collected each time you apply to our services. Which web pages of Mall of Turkey you visited, what you clicked, when you performed these actions etc. data shall be included. Besides, like many websites today, our network servers keep log files; these files save data each time a device accesses them. Log files; it contains data for each access, such as source IP addresses, internet service providers, files displayed on your site (HTML pages, graphics, etc.), operating system versions, and timestamps</li>\r\n<li><strong>Device Data: </strong>Data such as your IP address, operating system version, device type, system and performance information, and browser type are collected from the devices and applications you use to access our services.</li>\r\n<li><strong>Data From Third Parties: </strong>If you allow third parties to share your data with us, we shall process personal information or data about you from those third parties. For example; If you use the option to register and login to Mall of Turkey with your Facebook account details, your login information shall be verified by Facebook. We only process data that you explicitly accept to share with us about your Facebook account by allowing your Mall of Turkey account to be linked to your Facebook account.</li>\r\n<li><strong>Site Communication Tool Data: </strong>Our system automatically saves the data regarding the communication history and contents between Customer Services and Customers carried out via the Site Communication Tool. In case of any dispute and/or in cases where there may be a dispute, we may review and inspect these contents and communication records.</li>\r\n</ul>\r\n<p><strong>COOKIES:</strong></p>\r\n<p>Cookies are small data files that we collect on the device you use to access our services so that we can recognise users consistently. Depending on our reason for use, all cookies expire after a specific time. For further information, please check our &ldquo;Cookie Policy&rdquo; page on our website.</p>\r\n<p><strong>FOR WHAT PURPOSE DO WE PROCESS AND TRANSFER YOUR PERSONAL DATA?</strong></p>\r\n<p>The information collected by Mall of Turkey shall be used collectively in various ways to optimise the services of Mall of Turkey and improve the service offered to users through this database by enriching the database. Mall of Turkey shall use this information for website management, security, promotional activities, research and analysis. The information may be used in such a way that it can not identify users/visitors personally. No data processed will be made public.</p>\r\n<p>Your personal data may be shared with public institutions and organisations authorised to request personal data (in cases that there is an obligation to provide information such as crime and the threat of state and public security) to fulfil Mall of Turkey\'s obligations under the law.</p>\r\n<p>Mall of Turkey cooperates to carry out your personal data mentioned above with its own shareholders, the program partner institutions, and organisations, to ensure that the service provided to you is carried out in the best way, with its suppliers and third parties and institutions, where it received the data, and to send commercial electronic messages to its customers. It shares with third parties and organisations that it has contracted to send, the banks/payment gateway service providers we have contracted with, various agencies, advertising companies and survey companies and related business partners within the scope of various marketing activities to provide you better service and customer satisfaction. Mall of Turkey informs its customers in each personal data processing procedure regarding the relevant sharing procedure and ensures their explicit consent, if necessary.</p>\r\n<p>Mall of Turkey shall not cause users/visitors personal data to be leased, sold or shared to others or unaffiliated companies (for example, direct marketing purposes). However, Mall of Turkey shall share non-personal (anonymous) cumulative data with third parties.</p>\r\n<p><strong>WHICH METHOD AND LEGAL CAUSE WE PROCESS YOUR PERSONAL DATA?</strong></p>\r\n<p>Depending on the relevant process, your personal data mentioned above shall automatically processed electronically based on the legal reasons stated in Article 5 of the Law: &ldquo;explicit consent, processing of personal data belonging to the parties of a contract, is necessarily provided that it is directly related to the conclusion of fulfilment of that contract, the controller must be able to perform his legal obligations, it is mandatory for the legitimate interests of the controller, provided that this processing shall not violate the fundamental rights and freedoms of the data subject.&rdquo;</p>\r\n<p><strong>WHAT ARE YOUR RIGHTS ACCORDING TO THE LAW?</strong></p>\r\n<p>As stated in article 11 of the Law about your personal data, you may contact with Mall of Turkey at any time to obtain information regarding the following matters under the Law; Learn whether or not your personal data have been processed, Request information as to processing if your data have been processed; Learn the purpose of processing of the personal data and whether data&nbsp;are used in accordance with their purpose; Know the third parties in the country or abroad to whom personal data have been transferred; Request rectification in personal case data are processed incompletely or inaccurately; Request deletion or destruction of personal data within the framework of the conditions set forth under article, Request notification of the operations made as per indents and to third parties to whom personal data have been transferred; Object to occurrence of any result that is to your&nbsp;detriment by means of analysis of personal data exclusively through automated systems; Request compensation for the damages in case the person incurs damages due to unlawful processing of personal data. In accordance with the &ldquo;Communiqu&eacute; on the Procedures and Principles of Application to the Data Controller&rdquo;, you may submit your requests in written form regarding the above rights provided by the Law to ( ) Mall of Turkey Elektronik Hizmetler Anonim Şirketi.</p>\r\n<p>We may change this privacy policy at any time; however, we will notify you by posting the changes on the website. In some critical cases, we may report such changes by e-mail or other reasonable designed way to inform you, with additional notifications, as appropriate. Upon being informed about these changes, if you do not cancel your membership and continue to use our services after the notification period, you will be explicitly consented to make changes to our privacy policy. <br />If you do not accept the terms of this privacy policy or updated privacy policy (if any), you reserve the right to close your account or respond to surveys at any time.</p>\r\n<table style=\"height: 70px; width: 39.1083%;\">\r\n<tbody>\r\n<tr style=\"height: 70px;\">\r\n<td style=\"height: 70px; width: 100%;\" width=\"304\">\r\n<p><strong>Mall of Turkey Elektronik Hizmetler Anonim Şirketi</strong></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', NULL, NULL, NULL, '2021-07-30 17:08:44', '2021-07-30 17:08:44'),
(4, 'Return Policy', 'return-policy', '<p style=\"text-align: center;\"><strong>Return and Delivery Policy</strong></p>\r\n<ul>\r\n<li><strong><u>Can I cancel my order?</u></strong></li>\r\n</ul>\r\n<p>If your order is not delivered to the courier, please go to \"<strong>__________</strong>\" by visiting our website (www.mallofturkeya.com.tr) and click the Cancel button or&nbsp;send your requests to&nbsp;<strong>___________________&nbsp;&nbsp;</strong>to cancel your order or request product replacement.</p>\r\n<p>Once your order cancellation request is confirmed, you will be refunded on your credit card you used for the payment if it was made via credit card. Timing of refunds may vary depending on the banks\' internal processes and there might be delays. Please follow the process through your bank.&nbsp;In the case of&nbsp;<strong>payment in installments</strong>,&nbsp;refund is also performed in installments due to bank processes.</p>\r\n<ul>\r\n<li><strong><u>I want to return/replace my product. What are the Return/Replacement Terms?</u></strong></li>\r\n</ul>\r\n<p>To submit your product return/replacement requests, please visit our website, www.mallofturkeya.com.tr, and go to \"<strong>Membership/&nbsp;</strong><a href=\"https://www.olegcassini.com.tr/../../../../../customer/account/index/\"><strong>My Account</strong></a><strong>&nbsp;/ Product Return Request\"</strong>&nbsp;for submission of your request or email us at&nbsp;<strong>&nbsp;____@mallofturkeya.com.tr</strong>&nbsp;within&nbsp;<strong>_____days</strong>&nbsp;after you receive the shipped product from courier. You can return your product by submitting the&nbsp;_________.</p>\r\n<p>Please visit our website, www.mallofturkeya.com.tr, go to \"<strong>_________</strong>\" and click &ldquo;<strong>________</strong>&rdquo;&nbsp;from the top left corner to create a product return/replacement request. &nbsp;After selecting the order you want to proceed with, please first click&nbsp;<strong>x</strong>&nbsp;to remove products that you don\'t request any return / replacement and then select relevant items from &ldquo;<strong>package&rdquo; / &ldquo;request type&rdquo; / &ldquo;reason for return</strong>&rdquo;. Please click &ldquo;<strong>Submit request</strong>&rdquo; in the bottom right corner of the page to complete your return/replacement request.</p>\r\n<ul>\r\n<li><strong>Return/Replacement Terms<br /><br /></strong>-Product returns must be in the original box/package together with invoice. <br />-All standard product must be sent intact and undamaged in their original packages.<br />-Any promoted and campaign products given as gifts must also be sent in original packages.<br />-Products cannot be returned if the product is customized by consumer\'s personal needs or special demands, is not suitable for return due to the nature of product, has a perishable nature or may be expired in a short time.<br />-All kinds of Cosmetic and Personal Care Products, as well as any types of Software, Processor (CPU) Program, DVDs, VCDs, CDs and Cassettes, Computer and Stationery Consumable materials (e.g. toners, cartridges, stripes etc.) can only be returned if the original packaging is unopened.<br />-Hygienic products (e.g. underwear), supermarket products (e.g. food products) as well as periodical publications such as newspapers and magazines cannot be returned.<br />-Products valued in stock exchange or other organized markets (gold category) cannot be returned.</li>\r\n</ul>\r\n<p>Please note the abovementioned terms and return the product by specifying the company code_____</p>\r\n<p><u>Sender is responsible for covering the shipment fee for return transactions performed through other courier companies than DHL. </u></p>\r\n<ul>\r\n<li><strong><u>Legal entity refunds:</u></strong></li>\r\n</ul>\r\n<p>If you placed your order on www.mallofturkeya.com.tr as a legal entity and the invoice was issued on behalf of a company, you must issue a \"return invoice\" for your product return requests.&nbsp; Return invoices are issued with the exclusion of shipment fee by the organization a purchase invoice is issued for and delivered to Mall of Turkey. Product return requests will not be processed unless they are delivered to Mall of Turkey with a return invoice issued.</p>\r\n<p>The same procedures applied for individual customers are applicable to legal entities for replacement or return processes regarding the products purchased from www.mallofturkeya.com.tr.</p>\r\n<ul>\r\n<li><strong><u>When will the refund be reflected in my debit card/credit card upon confirmation of product return?</u></strong></li>\r\n</ul>\r\n<p>Upon confirmation of your product return, you will be automatically refunded</p>\r\n<ul>\r\n<li>on your credit card if the purchase was performed via credit card;</li>\r\n<li>on your debit card if the purchase was performed via wire transfer/EFT.</li>\r\n</ul>\r\n<p>Regarding both transactions, timing of refunds to your credit card/account may vary depending on the banks\' internal processes and there might be delays.&nbsp; Please follow the process through your bank. In the case of payment in installments,&nbsp;refund is also performed in installments due to bank processes.</p>\r\n<ul>\r\n<li><strong><u>Will my refund be deposited into a bank account/credit card other than the card used for purchase of the returned product?</u></strong></li>\r\n</ul>\r\n<p>If you return your purchases on www.mallofturkeya.com.tr, refund is deposited only into the payment method and instrument used while placing the order.</p>\r\n<ul>\r\n<li><strong><u>Will I be charged a shipment fee when I return the product?</u></strong></li>\r\n</ul>\r\n<p>You are not subject to a \"shipment fee\" when returning the products. You can therefore send the product for return/replacement by specifying the company code _______.</p>\r\n<ul>\r\n<li><strong><u>After sending the product, how can I track the status?</u></strong></li>\r\n</ul>\r\n<p>After your product is received by www.mallofturkeya.com.tr, its package, accessories and&nbsp;<strong>invoice(*)</strong>&nbsp;will be controlled.</p>\r\n<p>If product return is approved, &ldquo;<strong>product cost</strong>&rdquo; will be refunded to you within 10 working days depending on your preferences regarding product return application.</p>\r\n<p>If your return does not meet the product return criteria, the product will be shipped back to your address free of charge. To track your product\'s status, please go to \"<strong>My Orders</strong>\"&nbsp;under \"My Account\".</p>\r\n<p>(*)&nbsp;If you have issued a corporate invoice for product to be returned, you must submit it along with a return invoice issued by the relevant company. Return invoice must be issued without the shipment fee (e.g. product unit price + VAT).</p>\r\n<ul>\r\n<li><strong><u>The product I purchased turned out to be defective. What should I do?</u></strong></li>\r\n</ul>\r\n<p>Please contact us for any defect issues regarding your product within&nbsp;<strong>7&nbsp;days</strong>&nbsp;after receiving the product. You can return the product without paying any \"shipment fee\" by using the \'courier shipment code\' assigned.</p>\r\n<p>After the product is received by www.mallofturkeya.com.tr, it will be checked together with the package and accessories and sent for inspection. The product can either be replaced by a new product, refunded or shipped back to you after reparation within 20 working days following the receipt of the product by the Authorized Department based on the inspection report by the said department.</p>\r\n<p>However, if product defect is found to be associated with&nbsp;&ldquo;<strong>misuse</strong>&rdquo; (hitting, falling, liquid contact etc.), no actions will be taken.</p>\r\n<ul>\r\n<li><strong><u>How&nbsp; to send the defective product to www.mallofturkeya.com.tr?</u></strong></li>\r\n</ul>\r\n<p>Please refer to the below information to contact our shipping company.</p>\r\n<ul>\r\n<li><strong><u>Wrong products were delivered. What should I do?</u></strong></li>\r\n</ul>\r\n<p>Please click &ldquo;<strong>Return and Redelivery</strong>&rdquo; button on the right-hand side of the \"Order Tracking\" page. Please select the product to be processed and complete the \"Incorrect Product Delivery\" form provided in the \"Return and other transactions\" step. Please check the \"I have read and agree to the Return and Redelivery Terms\" box on the right-hand side of the page and click \"Continue\". A pop-up window will appear and you can follow the steps regarding the product you will return. Click Save and Finish, and your ticket will be created.&nbsp; Please send us the DHL Cargo shipment code displayed on the screen until the specified date.<br /><br /></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', NULL, NULL, NULL, '2021-07-30 17:12:23', '2021-07-30 17:12:23');
INSERT INTO `page_translates` (`id`, `page_id`, `language_id`, `title`, `data`, `meta_title`, `meta_desc`, `meta_keyword`, `status`, `created_at`, `updated_at`) VALUES
(1, 2, 1, 'Distance Sales Agreement', '<p><strong>PARTIES</strong></p>\r\n<p>This Contract is entered into between;</p>\r\n<p><strong>SELLER</strong></p>\r\n<p>Title :</p>\r\n<p>Mersis Number :</p>\r\n<p><strong>Address </strong></p>\r\n<p>E-mail :</p>\r\n<p>Phone Number :</p>\r\n<p><strong>PURCHASER</strong></p>\r\n<p>Name Surname/Title :</p>\r\n<p>Address:</p>\r\n<p>E-mail :</p>\r\n<p>Phone number :</p>\r\n<p>as of ../../&hellip; upon the acceptance and confirmation that were provided over the online platform.</p>\r\n<p>(Hereinafter individually referred to as &lsquo;&lsquo;Party&rsquo;&rsquo; and collectively a &lsquo;&lsquo;Parties&rsquo;&rsquo;.)</p>\r\n<p>For purposes of this Contract, the following terms shall have the following meanings:</p>\r\n<p><strong>MINISTRY : </strong>Ministry of Trade,</p>\r\n<p><strong>LAW : </strong>Law on Consumer Protection No. 6502,</p>\r\n<p><strong>REGULATION :</strong> Regulation on Distance Selling Contracts dated 27.11.2014 and published on</p>\r\n<p><strong>DPL :</strong> Personal Data Protection Law No. 6698,</p>\r\n<p><strong>PRODUCT :</strong> Goods to be sold under the web-site of the Mall of Turkey subject to the selling and purchasing processes governed under this Contract,</p>\r\n<p><strong>SELLER :</strong> The company that offers goods to the consumers within the context of its commercial or professional activities,</p>\r\n<p><strong>PURCHASER : </strong>Real or legal person who acquires, uses or benefits from a good or service for non-commercial or non-professional purposes,</p>\r\n<p><strong>WEBSITE : </strong>Seller&rsquo;s website,</p>\r\n<p><strong>ORDERER : </strong>Real or legal person who orders a good or service through Seller&rsquo;s website,</p>\r\n<p><strong>PARTIES :</strong> The Seller and the Purchaser,</p>\r\n<p><strong>AGREEMENT : </strong>The distance selling contract that Seller and the Purchaser concludes.</p>\r\n<p><strong>SUBJECT OF THE CONTRACT</strong></p>\r\n<p style=\"text-align: center;\"><strong>3.1</strong></p>\r\n<p>The subject of this Agreement is to set the rights and obligations of the Parties with regards to sale and delivery of products (\"Product/Products\"), for which the qualifications and prices are mentioned in the Contract and that the Customer orders through electronic platforms from the Seller\'s website <a href=\"https://shop.ltbjeans.com/\">https://www.mallofturkeya.com</a> (&ldquo;Website&rdquo;), in accordance with the provisions of the Law on Consumer Protection No. 6502 (\"Law\") and the Regulation on Distance Contracts dated 27.11.2014 (\"Regulation\").</p>\r\n<p style=\"text-align: center;\"><strong>3.2</strong></p>\r\n<p>The prices listed and announced on the Website are the sales prices. The prices announced on the Website are valid until they are updated or changed. The prices that are announced for a limited term are valid until the end of the specified term.</p>\r\n<p><strong>THE PRODUCT OR SERVICE THAT THE CONTRACT COVERS, PAYMENT AND DELIVERY</strong></p>\r\n<p>&nbsp;</p>\r\n<p>The type, quantity, brand, model, color and sale price (including VAT) of the Product or Products that constitute the subject of this Agreement are as follows:</p>\r\n<p>&nbsp;</p>\r\n<p>Method of Payment :</p>\r\n<p>Delivery Address :</p>\r\n<p>Recipient&rsquo;s Name :</p>\r\n<p>Billing Address :</p>\r\n<p><strong>RIGHTS, OBLIGATIONS AND STATEMENTS OF THE PARTIES</strong></p>\r\n<p>The Purchaser acknowledges, undertakes, and confirms that she/he has read and in electronic format approved the preliminary information form consisting of following information and that she/he has been informed accurately and fully about the following information; Product&rsquo;s qualifications and price (including VAT), method of payment, delivery, delivery cost, right of withdrawal, Purchaser&rsquo;s obligation to pay for the costs caused by usage of right of withdrawal, Seller&rsquo;s title, address and contact information.</p>\r\n<p style=\"text-align: center;\"><strong>5.2</strong></p>\r\n<p>The Purchaser, acknowledges, undertakes and confirms that by accepting the terms of this Contract that she/he has been informed about the following preliminary information and that she/he approved them in electronic format and then ordered the Product and/or Products; Product&rsquo;s qualifications and price (including VAT), method of payment, terms of delivery, all other preliminary information and right of withdrawal.</p>\r\n<p style=\"text-align: center;\"><strong>5.3</strong></p>\r\n<p>The delivery of the Product or Products will be made as soon as possible upon receiving the sales price on the condition that the Product or Products are in stock. The Purchaser shall be able to use one of her/his rights listed on Article 5.14 of this Contract if the stocks are not available for the ordered Product. The Seller acknowledges, undertakes, and confirms that it will, in no more than 30 days, depending on the distance of the Purchasers place of settlement, deliver the Product or Products to the delivery address of the Purchaser.</p>\r\n<p style=\"text-align: center;\"><strong>5.4</strong></p>\r\n<p>The Seller acknowledges, undertakes and confirms that it is responsible for delivering the Product or Products subject to this Contract in full, in accordance with the qualifications specified in the Contract, with the certificate of warranty and user guide and all other necessary documents and information.</p>\r\n<p style=\"text-align: center;\"><strong>5.5</strong></p>\r\n<p>If the Seller has declared that the delivery cost of the Purchaser who exceed the total amount specified on the Website will be covered by the Seller or that it will make free delivery within a campaign, the delivery cost belongs to the Seller. However, there isn&rsquo;t any statement regarding free delivery, the delivery costs will be covered by the Purchaser.</p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\"><strong>5.6</strong></p>\r\n<p>The Customer shall check the Product or Products subject to the Contract at the time of delivery but before receiving them and he/she will not accept them if crushed, broken, torn or somehow damaged or defected.</p>\r\n<p style=\"text-align: center;\"><strong>5.7</strong></p>\r\n<p>The Purchaser acknowledges, confirms and undertakes that the Product or Products received from the cargo company are delivered to him in full, undamaged and without a defect. It is Purchaser&rsquo;s responsibility to keep the products safe after the delivery. If the right of withdrawal will be used then the Product or Products should not be used. The invoice must also be returned with the Product or Products. The Seller reserves the right to not accept the return of the Products or Products if the Products or Products returned by using the right of withdrawal have been used.</p>\r\n<p style=\"text-align: center;\"><strong>5.8</strong></p>\r\n<p>The Purchaser acknowledges, confirms and undertakes that if the bank or financial institution concerned does not pay the Seller the price of the Products or Products due to the unfair or unlawful use of the Purchaser\'s credit card by unauthorized persons after the delivery of the Product or Products, the Purchaser is obliged to send the Product or Products to the Seller within 3 (Three) days, in which case delivery cost belongs to the Purchaser.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p style=\"text-align: center;\"><strong>5.9. </strong></p>\r\n<p>If for any reason the Seller is not paid for the Products or Products, or that the payment cancelled in the bank records, the seller shall be free of its obligation to deliver the Product or Products.</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p style=\"text-align: center;\"><strong>5.10</strong></p>\r\n<p>The Parties acknowledge, confirm and undertake that if Product or Products are asked to be delivered to a third person other than the Purchaser, the Seller is not responsible for the occasions where the third person does not accept the delivery.</p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\"><strong>5.10</strong></p>\r\n<p>The Seller may provide other Product or Products of equal quality and price to the Purchaser before the period determined for performing its duties in the Contract expires if there is a fair justification. If the Seller believes that performing its duties have become impossible, she/he shall notify the Purchaser before the period for performing its duties in the Contract expires. The price paid and the documents, if any, shall be returned to the Purchaser within 10 (Ten) working days.</p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\"><strong>5.12</strong></p>\r\n<p>The Seller shall not be held responsible if the ordered Product or Products cannot be delivered to the delivery address of the Purchaser specified in this Contract due to any problems that the delivery company will encounter during the delivery of the Product or Products to the Purchaser.</p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\"><strong>5.13</strong></p>\r\n<p>If the Seller cannot deliver the Product or Products in cases where the delivery of the Product or Products has become impossible, it shall notify the Purchaser before the period for performing its duties under the Contract expires and can provide the Purchaser with other Product or Products of equal quality and value.</p>\r\n<p style=\"text-align: center;\"><strong>5.16</strong></p>\r\n<p>For Purchaser\'s credit card payments, the amount paid for the Product or Products is refunded to the relevant bank within 7 days after the order is canceled by the Purchaser. The reflection of this amount on Purchaser\'s bank account after the refund is entirely related to the bank\'s transaction processes and it is not possible for Seller to intervene in any way regarding this issue.</p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\"><strong>5.17</strong></p>\r\n<p>The vouchers -if any- that Purchaser has for use on the Website can only be used once for each order. If used 2 or more times, the order will be canceled, and the amount paid will be refunded.</p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\"><strong>5.18</strong></p>\r\n<p>Seller reserves the right to stop the order where it deems necessary when the information provided by the Customer are not accurate. In cases where the Seller detects problems with the order, the Seller is entitled to freeze the order for 15 (fifteen) days, if it cannot contact with the Purchaser through the phone number, e-mail and mail addresses provided by the Purchaser for. The Purchaser is expected to contact the Seller during this period. If no response is received from the Customer during this period, Seller cancels the order to avoid possible damages for both parties. If the Purchaser places an order with payment through wire transfer for two consecutive times and does not make the payment, the Seller reserves the right to cancel that Purchaser\'s other orders placed with payment through wire transfer. If the Purchaser refuses the delivery for her/his orders placed with payment on delivery, the Seller is entitled to cancel Purchaser&rsquo;s other orders placed with payment on delivery.</p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\"><strong>5.19</strong></p>\r\n<p>The Product or Products covered under a campaign can only be exchanged with Product or Products under the same campaign. In case the Product or Products under a campaign are asked to be replaced with Product or Products that are not covered under the same campaign, the Product or Products in the possession of Purchaser will be evaluated with their season price and the remaining balance will only be able to be used for the categories that are not covered under the campaign.</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p style=\"text-align: center;\"><strong>5.20</strong></p>\r\n<p>In the process of returning the Product/Products covered under a campaign, it is mandatory for Purchaser to send all the Product/Products he purchased from that campaign to the Seller. If only one product is sent to Seller for the return of Product/Products covered under the campaign; the Product or Products that are not sent will be evaluated with their season price and the remaining balance will be refunded accordingly.</p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\"><strong>5.21</strong></p>\r\n<p>Purchaser who violates the provisions of this Contract shall be personally responsible for this violation in terms of both civil and criminal law. The Seller shall not be liable for the legal and criminal consequences of these violations. In addition, Seller reserves the rights to file a lawsuit and complain in any way due to this violation.</p>\r\n<p><strong>RIGHT OF WITHDRAWAL AND CHANGING</strong></p>\r\n<p style=\"text-align: center;\"><strong>6.1</strong></p>\r\n<p>The Purchaser, without any reason and within 14 (Fourteen) days upon the delivery of the Product/Products to the delivery address specified in this Contract, may exercise the right of withdrawal, or change the Product/Products she/he bought.</p>\r\n<p style=\"text-align: center;\"><strong>6.2</strong></p>\r\n<p>In order to exercise the right of withdrawal, it is imperative that the Seller is notified by phone or e-mail within the 14 (Fourteen) days period and that the Product/Products that are intended to be returned must not have been used as explained in the provisions of Article 6 of this Agreement and must be in a form that the Seller may resell. If the right of withdrawal is exercised:</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p style=\"text-align: center;\"><strong>6.3</strong></p>\r\n<p>The invoice of the Products/Products delivered to the delivery address specified by the Purchaser in this Contract must be delivered to the Seller in full and undamaged, together with the return form, the box, packaging and the standard accessories of the Product/Products if any. (If the invoice of the Product/Products to be returned is corporate invoice, it must be sent with the return invoice issued by the purchaser institution when returning. The orders for which the invoice is issued for purchaser institutions, cannot be returned without a return invoice issued by the purchaser institution)</p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\"><strong>6.4</strong></p>\r\n<p>Within 10 (Ten) working days following the arrival of the items listed in Article 6.2 to the Seller, the amount paid for the Product/Products will be returned to the Purchaser or Product/Products will be changed.</p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\"><strong>6.5</strong></p>\r\n<p>All delivery costs of the Product/Products returned for any reason during the specified period, including delivery to the Purchaser, will be covered by the Seller. In case of change, the delivery costs related to the first change will be covered by the Seller and the second change cost will be covered by the Customer if the same Product/Products are changed twice. The same product cannot be changed more than 2 times within the same order. The service fee charged by the cargo company within the payment made for Product/Products in connection with the orders placed with payment on delivery is not refundable.</p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\"><strong>6.6</strong></p>\r\n<p>When returning the Product/Products to the Seller, the original invoice submitted to the Purchaser at the time of delivery must also be returned to the Seller, and if the invoice is not sent to the Seller with the Product/Products or within 5 (Five) days of the shipment of the Products/Products at the latest, the refund will not be made, and the Product/Products will be sent back to the Purchaser in the same way as a counter-payment.</p>\r\n<p style=\"text-align: center;\"><strong>6.7</strong></p>\r\n<p>The Purchaser will write &lsquo;&lsquo;This is a return invoice&rsquo;&rsquo; on the invoice that will be returned and sign it.</p>\r\n<p><strong>PROTECTION OF PERSONAL DATA</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p style=\"text-align: center;\"><strong>7.1</strong></p>\r\n<p>The Seller acknowledges, confirms and undertakes that it will securely store any personal data transferred to it by the Purchaser under the Contract. It is Seller\'s own legal responsibility to carry out any data processing activities other than this transfer purpose such as fulfilling the obligations stipulated in the applicable legislation for explicit consent, clarification, etc. if necessary.</p>\r\n<p style=\"text-align: center;\"><strong>7.2</strong></p>\r\n<p>The Parties acknowledge and confirm that they obtained, processed, stored and transferred the personal data they will transfer to each other in compliance with the procedures and principles in the DPL, the relevant regulatory actions, and the provisions on the protection of personal data contained in the relevant legislation. In addition, the Parties acknowledge and confirm that the owners of the relevant personal data are clearly informed in accordance with the procedures and principles contained in the DPL, the relevant regulatory actions, the provisions on the protection of personal data contained in the relevant legislation, and that the explicit consent of the data owners is obtained if required by the circumstances.</p>\r\n<ol>\r\n<li><strong> </strong><strong>PRODUCTS THAT CANNOT BE USED WITH THE RIGHT OF WITHDRAWAL</strong></li>\r\n</ol>\r\n<p>For the Products whose protective elements such as packaging, tape, seal, package have been opened after deliver yor Products that are not suitable for return in terms of health and hygiene shall not be accepted for right of withdrawal; &nbsp;</p>\r\n<p><strong>GOVERNING LAW AND JURISDICTION</strong></p>\r\n<p style=\"text-align: center;\"><strong>9.1</strong></p>\r\n<p>This agreement shall be governed by Turkish Law and any disputes that may arise out of this Agreement shall be settled by the Courts and Execution Offices of Istanbul.</p>\r\n<p style=\"text-align: center;\"><strong>9.2</strong></p>\r\n<p>In this respect, Consumer Arbitration Committees and Consumer Courts and Enforcement Offices in the Customer\'s settlement are authorized up to the value announced by the Ministry of Trade under Turkish Law.</p>\r\n<p><strong>MISCELLANEOUS</strong></p>\r\n<p style=\"text-align: center;\"><strong>10.1</strong></p>\r\n<p>If any provision or part of this Agreement is held invalid under any law, by any legal or governmental authority or court, such provision shall not affect the validity of the remaining provisions.</p>\r\n<p style=\"text-align: center;\"><strong>10.2</strong></p>\r\n<p>Parties accept that the above-specified addresses are their legal notification addresses.&nbsp; Unless any address changes are notified to the other party in writing, the notices served to the above addresses shall be legally binding.</p>\r\n<p style=\"text-align: center;\"><strong>10.3</strong></p>\r\n<p>This Agreement has been confirmed by the duly authorized representatives of the Parties via <a href=\"http://www.malofturkeya.com.tr\">www.malofturkeya.com.tr</a></p>\r\n<p>&nbsp;</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p>&nbsp;</p>', NULL, NULL, NULL, 1, '2021-07-30 16:59:36', '2021-07-30 16:59:36'),
(2, 2, 8, 'Distance Sales Agreement', '<p><strong>PARTIES</strong></p>\r\n<p>This Contract is entered into between;</p>\r\n<p><strong>SELLER</strong></p>\r\n<p>Title :</p>\r\n<p>Mersis Number :</p>\r\n<p><strong>Address </strong></p>\r\n<p>E-mail :</p>\r\n<p>Phone Number :</p>\r\n<p><strong>PURCHASER</strong></p>\r\n<p>Name Surname/Title :</p>\r\n<p>Address:</p>\r\n<p>E-mail :</p>\r\n<p>Phone number :</p>\r\n<p>as of ../../&hellip; upon the acceptance and confirmation that were provided over the online platform.</p>\r\n<p>(Hereinafter individually referred to as &lsquo;&lsquo;Party&rsquo;&rsquo; and collectively a &lsquo;&lsquo;Parties&rsquo;&rsquo;.)</p>\r\n<p>For purposes of this Contract, the following terms shall have the following meanings:</p>\r\n<p><strong>MINISTRY : </strong>Ministry of Trade,</p>\r\n<p><strong>LAW : </strong>Law on Consumer Protection No. 6502,</p>\r\n<p><strong>REGULATION :</strong> Regulation on Distance Selling Contracts dated 27.11.2014 and published on</p>\r\n<p><strong>DPL :</strong> Personal Data Protection Law No. 6698,</p>\r\n<p><strong>PRODUCT :</strong> Goods to be sold under the web-site of the Mall of Turkey subject to the selling and purchasing processes governed under this Contract,</p>\r\n<p><strong>SELLER :</strong> The company that offers goods to the consumers within the context of its commercial or professional activities,</p>\r\n<p><strong>PURCHASER : </strong>Real or legal person who acquires, uses or benefits from a good or service for non-commercial or non-professional purposes,</p>\r\n<p><strong>WEBSITE : </strong>Seller&rsquo;s website,</p>\r\n<p><strong>ORDERER : </strong>Real or legal person who orders a good or service through Seller&rsquo;s website,</p>\r\n<p><strong>PARTIES :</strong> The Seller and the Purchaser,</p>\r\n<p><strong>AGREEMENT : </strong>The distance selling contract that Seller and the Purchaser concludes.</p>\r\n<p><strong>SUBJECT OF THE CONTRACT</strong></p>\r\n<p style=\"text-align: center;\"><strong>3.1</strong></p>\r\n<p>The subject of this Agreement is to set the rights and obligations of the Parties with regards to sale and delivery of products (\"Product/Products\"), for which the qualifications and prices are mentioned in the Contract and that the Customer orders through electronic platforms from the Seller\'s website <a href=\"https://shop.ltbjeans.com/\">https://www.mallofturkeya.com</a> (&ldquo;Website&rdquo;), in accordance with the provisions of the Law on Consumer Protection No. 6502 (\"Law\") and the Regulation on Distance Contracts dated 27.11.2014 (\"Regulation\").</p>\r\n<p style=\"text-align: center;\"><strong>3.2</strong></p>\r\n<p>The prices listed and announced on the Website are the sales prices. The prices announced on the Website are valid until they are updated or changed. The prices that are announced for a limited term are valid until the end of the specified term.</p>\r\n<p><strong>THE PRODUCT OR SERVICE THAT THE CONTRACT COVERS, PAYMENT AND DELIVERY</strong></p>\r\n<p>&nbsp;</p>\r\n<p>The type, quantity, brand, model, color and sale price (including VAT) of the Product or Products that constitute the subject of this Agreement are as follows:</p>\r\n<p>&nbsp;</p>\r\n<p>Method of Payment :</p>\r\n<p>Delivery Address :</p>\r\n<p>Recipient&rsquo;s Name :</p>\r\n<p>Billing Address :</p>\r\n<p><strong>RIGHTS, OBLIGATIONS AND STATEMENTS OF THE PARTIES</strong></p>\r\n<p>The Purchaser acknowledges, undertakes, and confirms that she/he has read and in electronic format approved the preliminary information form consisting of following information and that she/he has been informed accurately and fully about the following information; Product&rsquo;s qualifications and price (including VAT), method of payment, delivery, delivery cost, right of withdrawal, Purchaser&rsquo;s obligation to pay for the costs caused by usage of right of withdrawal, Seller&rsquo;s title, address and contact information.</p>\r\n<p style=\"text-align: center;\"><strong>5.2</strong></p>\r\n<p>The Purchaser, acknowledges, undertakes and confirms that by accepting the terms of this Contract that she/he has been informed about the following preliminary information and that she/he approved them in electronic format and then ordered the Product and/or Products; Product&rsquo;s qualifications and price (including VAT), method of payment, terms of delivery, all other preliminary information and right of withdrawal.</p>\r\n<p style=\"text-align: center;\"><strong>5.3</strong></p>\r\n<p>The delivery of the Product or Products will be made as soon as possible upon receiving the sales price on the condition that the Product or Products are in stock. The Purchaser shall be able to use one of her/his rights listed on Article 5.14 of this Contract if the stocks are not available for the ordered Product. The Seller acknowledges, undertakes, and confirms that it will, in no more than 30 days, depending on the distance of the Purchasers place of settlement, deliver the Product or Products to the delivery address of the Purchaser.</p>\r\n<p style=\"text-align: center;\"><strong>5.4</strong></p>\r\n<p>The Seller acknowledges, undertakes and confirms that it is responsible for delivering the Product or Products subject to this Contract in full, in accordance with the qualifications specified in the Contract, with the certificate of warranty and user guide and all other necessary documents and information.</p>\r\n<p style=\"text-align: center;\"><strong>5.5</strong></p>\r\n<p>If the Seller has declared that the delivery cost of the Purchaser who exceed the total amount specified on the Website will be covered by the Seller or that it will make free delivery within a campaign, the delivery cost belongs to the Seller. However, there isn&rsquo;t any statement regarding free delivery, the delivery costs will be covered by the Purchaser.</p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\"><strong>5.6</strong></p>\r\n<p>The Customer shall check the Product or Products subject to the Contract at the time of delivery but before receiving them and he/she will not accept them if crushed, broken, torn or somehow damaged or defected.</p>\r\n<p style=\"text-align: center;\"><strong>5.7</strong></p>\r\n<p>The Purchaser acknowledges, confirms and undertakes that the Product or Products received from the cargo company are delivered to him in full, undamaged and without a defect. It is Purchaser&rsquo;s responsibility to keep the products safe after the delivery. If the right of withdrawal will be used then the Product or Products should not be used. The invoice must also be returned with the Product or Products. The Seller reserves the right to not accept the return of the Products or Products if the Products or Products returned by using the right of withdrawal have been used.</p>\r\n<p style=\"text-align: center;\"><strong>5.8</strong></p>\r\n<p>The Purchaser acknowledges, confirms and undertakes that if the bank or financial institution concerned does not pay the Seller the price of the Products or Products due to the unfair or unlawful use of the Purchaser\'s credit card by unauthorized persons after the delivery of the Product or Products, the Purchaser is obliged to send the Product or Products to the Seller within 3 (Three) days, in which case delivery cost belongs to the Purchaser.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p style=\"text-align: center;\"><strong>5.9. </strong></p>\r\n<p>If for any reason the Seller is not paid for the Products or Products, or that the payment cancelled in the bank records, the seller shall be free of its obligation to deliver the Product or Products.</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p style=\"text-align: center;\"><strong>5.10</strong></p>\r\n<p>The Parties acknowledge, confirm and undertake that if Product or Products are asked to be delivered to a third person other than the Purchaser, the Seller is not responsible for the occasions where the third person does not accept the delivery.</p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\"><strong>5.10</strong></p>\r\n<p>The Seller may provide other Product or Products of equal quality and price to the Purchaser before the period determined for performing its duties in the Contract expires if there is a fair justification. If the Seller believes that performing its duties have become impossible, she/he shall notify the Purchaser before the period for performing its duties in the Contract expires. The price paid and the documents, if any, shall be returned to the Purchaser within 10 (Ten) working days.</p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\"><strong>5.12</strong></p>\r\n<p>The Seller shall not be held responsible if the ordered Product or Products cannot be delivered to the delivery address of the Purchaser specified in this Contract due to any problems that the delivery company will encounter during the delivery of the Product or Products to the Purchaser.</p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\"><strong>5.13</strong></p>\r\n<p>If the Seller cannot deliver the Product or Products in cases where the delivery of the Product or Products has become impossible, it shall notify the Purchaser before the period for performing its duties under the Contract expires and can provide the Purchaser with other Product or Products of equal quality and value.</p>\r\n<p style=\"text-align: center;\"><strong>5.16</strong></p>\r\n<p>For Purchaser\'s credit card payments, the amount paid for the Product or Products is refunded to the relevant bank within 7 days after the order is canceled by the Purchaser. The reflection of this amount on Purchaser\'s bank account after the refund is entirely related to the bank\'s transaction processes and it is not possible for Seller to intervene in any way regarding this issue.</p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\"><strong>5.17</strong></p>\r\n<p>The vouchers -if any- that Purchaser has for use on the Website can only be used once for each order. If used 2 or more times, the order will be canceled, and the amount paid will be refunded.</p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\"><strong>5.18</strong></p>\r\n<p>Seller reserves the right to stop the order where it deems necessary when the information provided by the Customer are not accurate. In cases where the Seller detects problems with the order, the Seller is entitled to freeze the order for 15 (fifteen) days, if it cannot contact with the Purchaser through the phone number, e-mail and mail addresses provided by the Purchaser for. The Purchaser is expected to contact the Seller during this period. If no response is received from the Customer during this period, Seller cancels the order to avoid possible damages for both parties. If the Purchaser places an order with payment through wire transfer for two consecutive times and does not make the payment, the Seller reserves the right to cancel that Purchaser\'s other orders placed with payment through wire transfer. If the Purchaser refuses the delivery for her/his orders placed with payment on delivery, the Seller is entitled to cancel Purchaser&rsquo;s other orders placed with payment on delivery.</p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\"><strong>5.19</strong></p>\r\n<p>The Product or Products covered under a campaign can only be exchanged with Product or Products under the same campaign. In case the Product or Products under a campaign are asked to be replaced with Product or Products that are not covered under the same campaign, the Product or Products in the possession of Purchaser will be evaluated with their season price and the remaining balance will only be able to be used for the categories that are not covered under the campaign.</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p style=\"text-align: center;\"><strong>5.20</strong></p>\r\n<p>In the process of returning the Product/Products covered under a campaign, it is mandatory for Purchaser to send all the Product/Products he purchased from that campaign to the Seller. If only one product is sent to Seller for the return of Product/Products covered under the campaign; the Product or Products that are not sent will be evaluated with their season price and the remaining balance will be refunded accordingly.</p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\"><strong>5.21</strong></p>\r\n<p>Purchaser who violates the provisions of this Contract shall be personally responsible for this violation in terms of both civil and criminal law. The Seller shall not be liable for the legal and criminal consequences of these violations. In addition, Seller reserves the rights to file a lawsuit and complain in any way due to this violation.</p>\r\n<p><strong>RIGHT OF WITHDRAWAL AND CHANGING</strong></p>\r\n<p style=\"text-align: center;\"><strong>6.1</strong></p>\r\n<p>The Purchaser, without any reason and within 14 (Fourteen) days upon the delivery of the Product/Products to the delivery address specified in this Contract, may exercise the right of withdrawal, or change the Product/Products she/he bought.</p>\r\n<p style=\"text-align: center;\"><strong>6.2</strong></p>\r\n<p>In order to exercise the right of withdrawal, it is imperative that the Seller is notified by phone or e-mail within the 14 (Fourteen) days period and that the Product/Products that are intended to be returned must not have been used as explained in the provisions of Article 6 of this Agreement and must be in a form that the Seller may resell. If the right of withdrawal is exercised:</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p style=\"text-align: center;\"><strong>6.3</strong></p>\r\n<p>The invoice of the Products/Products delivered to the delivery address specified by the Purchaser in this Contract must be delivered to the Seller in full and undamaged, together with the return form, the box, packaging and the standard accessories of the Product/Products if any. (If the invoice of the Product/Products to be returned is corporate invoice, it must be sent with the return invoice issued by the purchaser institution when returning. The orders for which the invoice is issued for purchaser institutions, cannot be returned without a return invoice issued by the purchaser institution)</p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\"><strong>6.4</strong></p>\r\n<p>Within 10 (Ten) working days following the arrival of the items listed in Article 6.2 to the Seller, the amount paid for the Product/Products will be returned to the Purchaser or Product/Products will be changed.</p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\"><strong>6.5</strong></p>\r\n<p>All delivery costs of the Product/Products returned for any reason during the specified period, including delivery to the Purchaser, will be covered by the Seller. In case of change, the delivery costs related to the first change will be covered by the Seller and the second change cost will be covered by the Customer if the same Product/Products are changed twice. The same product cannot be changed more than 2 times within the same order. The service fee charged by the cargo company within the payment made for Product/Products in connection with the orders placed with payment on delivery is not refundable.</p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\"><strong>6.6</strong></p>\r\n<p>When returning the Product/Products to the Seller, the original invoice submitted to the Purchaser at the time of delivery must also be returned to the Seller, and if the invoice is not sent to the Seller with the Product/Products or within 5 (Five) days of the shipment of the Products/Products at the latest, the refund will not be made, and the Product/Products will be sent back to the Purchaser in the same way as a counter-payment.</p>\r\n<p style=\"text-align: center;\"><strong>6.7</strong></p>\r\n<p>The Purchaser will write &lsquo;&lsquo;This is a return invoice&rsquo;&rsquo; on the invoice that will be returned and sign it.</p>\r\n<p><strong>PROTECTION OF PERSONAL DATA</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p style=\"text-align: center;\"><strong>7.1</strong></p>\r\n<p>The Seller acknowledges, confirms and undertakes that it will securely store any personal data transferred to it by the Purchaser under the Contract. It is Seller\'s own legal responsibility to carry out any data processing activities other than this transfer purpose such as fulfilling the obligations stipulated in the applicable legislation for explicit consent, clarification, etc. if necessary.</p>\r\n<p style=\"text-align: center;\"><strong>7.2</strong></p>\r\n<p>The Parties acknowledge and confirm that they obtained, processed, stored and transferred the personal data they will transfer to each other in compliance with the procedures and principles in the DPL, the relevant regulatory actions, and the provisions on the protection of personal data contained in the relevant legislation. In addition, the Parties acknowledge and confirm that the owners of the relevant personal data are clearly informed in accordance with the procedures and principles contained in the DPL, the relevant regulatory actions, the provisions on the protection of personal data contained in the relevant legislation, and that the explicit consent of the data owners is obtained if required by the circumstances.</p>\r\n<ol>\r\n<li><strong> </strong><strong>PRODUCTS THAT CANNOT BE USED WITH THE RIGHT OF WITHDRAWAL</strong></li>\r\n</ol>\r\n<p>For the Products whose protective elements such as packaging, tape, seal, package have been opened after deliver yor Products that are not suitable for return in terms of health and hygiene shall not be accepted for right of withdrawal; &nbsp;</p>\r\n<p><strong>GOVERNING LAW AND JURISDICTION</strong></p>\r\n<p style=\"text-align: center;\"><strong>9.1</strong></p>\r\n<p>This agreement shall be governed by Turkish Law and any disputes that may arise out of this Agreement shall be settled by the Courts and Execution Offices of Istanbul.</p>\r\n<p style=\"text-align: center;\"><strong>9.2</strong></p>\r\n<p>In this respect, Consumer Arbitration Committees and Consumer Courts and Enforcement Offices in the Customer\'s settlement are authorized up to the value announced by the Ministry of Trade under Turkish Law.</p>\r\n<p><strong>MISCELLANEOUS</strong></p>\r\n<p style=\"text-align: center;\"><strong>10.1</strong></p>\r\n<p>If any provision or part of this Agreement is held invalid under any law, by any legal or governmental authority or court, such provision shall not affect the validity of the remaining provisions.</p>\r\n<p style=\"text-align: center;\"><strong>10.2</strong></p>\r\n<p>Parties accept that the above-specified addresses are their legal notification addresses.&nbsp; Unless any address changes are notified to the other party in writing, the notices served to the above addresses shall be legally binding.</p>\r\n<p style=\"text-align: center;\"><strong>10.3</strong></p>\r\n<p>This Agreement has been confirmed by the duly authorized representatives of the Parties via <a href=\"http://www.malofturkeya.com.tr\">www.malofturkeya.com.tr</a></p>\r\n<p>&nbsp;</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p>&nbsp;</p>', NULL, NULL, NULL, 1, '2021-07-30 16:59:36', '2021-07-30 16:59:36');
INSERT INTO `page_translates` (`id`, `page_id`, `language_id`, `title`, `data`, `meta_title`, `meta_desc`, `meta_keyword`, `status`, `created_at`, `updated_at`) VALUES
