roducts that you don\'t request any return / replacement and then select relevant items from &ldquo;<strong>package&rdquo; / &ldquo;request type&rdquo; / &ldquo;reason for return</strong>&rdquo;. Please click &ldquo;<strong>Submit request</strong>&rdquo; in the bottom right corner of the page to complete your return/replacement request.</p>\r\n<ul>\r\n<li><strong>Return/Replacement Terms<br /><br /></strong>-Product returns must be in the original box/package together with invoice. <br />-All standard product must be sent intact and undamaged in their original packages.<br />-Any promoted and campaign products given as gifts must also be sent in original packages.<br />-Products cannot be returned if the product is customized by consumer\'s personal needs or special demands, is not suitable for return due to the nature of product, has a perishable nature or may be expired in a short time.<br />-All kinds of Cosmetic and Personal Care Products, as well as any types of Software, Processor (CPU) Program, DVDs, VCDs, CDs and Cassettes, Computer and Stationery Consumable materials (e.g. toners, cartridges, stripes etc.) can only be returned if the original packaging is unopened.<br />-Hygienic products (e.g. underwear), supermarket products (e.g. food products) as well as periodical publications such as newspapers and magazines cannot be returned.<br />-Products valued in stock exchange or other organized markets (gold category) cannot be returned.</li>\r\n</ul>\r\n<p>Please note the abovementioned terms and return the product by specifying the company code_____</p>\r\n<p><u>Sender is responsible for covering the shipment fee for return transactions performed through other courier companies than DHL. </u></p>\r\n<ul>\r\n<li><strong><u>Legal entity refunds:</u></strong></li>\r\n</ul>\r\n<p>If you placed your order on www.mallofturkeya.com.tr as a legal entity and the invoice was issued on behalf of a company, you must issue a \"return invoice\" for your product return requests.&nbsp; Return invoices are issued with the exclusion of shipment fee by the organization a purchase invoice is issued for and delivered to Mall of Turkey. Product return requests will not be processed unless they are delivered to Mall of Turkey with a return invoice issued.</p>\r\n<p>The same procedures applied for individual customers are applicable to legal entities for replacement or return processes regarding the products purchased from www.mallofturkeya.com.tr.</p>\r\n<ul>\r\n<li><strong><u>When will the refund be reflected in my debit card/credit card upon confirmation of product return?</u></strong></li>\r\n</ul>\r\n<p>Upon confirmation of your product return, you will be automatically refunded</p>\r\n<ul>\r\n<li>on your credit card if the purchase was performed via credit card;</li>\r\n<li>on your debit card if the purchase was performed via wire transfer/EFT.</li>\r\n</ul>\r\n<p>Regarding both transactions, timing of refunds to your credit card/account may vary depending on the banks\' internal processes and there might be delays.&nbsp; Please follow the process through your bank. In the case of payment in installments,&nbsp;refund is also performed in installments due to bank processes.</p>\r\n<ul>\r\n<li><strong><u>Will my refund be deposited into a bank account/credit card other than the card used for purchase of the returned product?</u></strong></li>\r\n</ul>\r\n<p>If you return your purchases on www.mallofturkeya.com.tr, refund is deposited only into the payment method and instrument used while placing the order.</p>\r\n<ul>\r\n<li><strong><u>Will I be charged a shipment fee when I return the product?</u></strong></li>\r\n</ul>\r\n<p>You are not subject to a \"shipment fee\" when returning the products. You can therefore send the product for return/replacement by specifying the company code _______.</p>\r\n<ul>\r\n<li><strong><u>After sending the product, how can I track the status?</u></strong></li>\r\n</ul>\r\n<p>After your product is received by www.mallofturkeya.com.tr, its package, accessories and&nbsp;<strong>invoice(*)</strong>&nbsp;will be controlled.</p>\r\n<p>If product return is approved, &ldquo;<strong>product cost</strong>&rdquo; will be refunded to you within 10 working days depending on your preferences regarding product return application.</p>\r\n<p>If your return does not meet the product return criteria, the product will be shipped back to your address free of charge. To track your product\'s status, please go to \"<strong>My Orders</strong>\"&nbsp;under \"My Account\".</p>\r\n<p>(*)&nbsp;If you have issued a corporate invoice for product to be returned, you must submit it along with a return invoice issued by the relevant company. Return invoice must be issued without the shipment fee (e.g. product unit price + VAT).</p>\r\n<ul>\r\n<li><strong><u>The product I purchased turned out to be defective. What should I do?</u></strong></li>\r\n</ul>\r\n<p>Please contact us for any defect issues regarding your product within&nbsp;<strong>7&nbsp;days</strong>&nbsp;after receiving the product. You can return the product without paying any \"shipment fee\" by using the \'courier shipment code\' assigned.</p>\r\n<p>After the product is received by www.mallofturkeya.com.tr, it will be checked together with the package and accessories and sent for inspection. The product can either be replaced by a new product, refunded or shipped back to you after reparation within 20 working days following the receipt of the product by the Authorized Department based on the inspection report by the said department.</p>\r\n<p>However, if product defect is found to be associated with&nbsp;&ldquo;<strong>misuse</strong>&rdquo; (hitting, falling, liquid contact etc.), no actions will be taken.</p>\r\n<ul>\r\n<li><strong><u>How&nbsp; to send the defective product to www.mallofturkeya.com.tr?</u></strong></li>\r\n</ul>\r\n<p>Please refer to the below information to contact our shipping company.</p>\r\n<ul>\r\n<li><strong><u>Wrong products were delivered. What should I do?</u></strong></li>\r\n</ul>\r\n<p>Please click &ldquo;<strong>Return and Redelivery</strong>&rdquo; button on the right-hand side of the \"Order Tracking\" page. Please select the product to be processed and complete the \"Incorrect Product Delivery\" form provided in the \"Return and other transactions\" step. Please check the \"I have read and agree to the Return and Redelivery Terms\" box on the right-hand side of the page and click \"Continue\". A pop-up window will appear and you can follow the steps regarding the product you will return. Click Save and Finish, and your ticket will be created.&nbsp; Please send us the DHL Cargo shipment code displayed on the screen until the specified date.<br /><br /></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', NULL, NULL, NULL, 1, '2021-07-30 17:12:23', '2021-07-30 17:12:23'),
(9, 4, 164, 'Return Policy', '<p style=\"text-align: center;\"><strong>Return and Delivery Policy</strong></p>\r\n<ul>\r\n<li><strong><u>Can I cancel my order?</u></strong></li>\r\n</ul>\r\n<p>If your order is not delivered to the courier, please go to \"<strong>__________</strong>\" by visiting our website (www.mallofturkeya.com.tr) and click the Cancel button or&nbsp;send your requests to&nbsp;<strong>___________________&nbsp;&nbsp;</strong>to cancel your order or request product replacement.</p>\r\n<p>Once your order cancellation request is confirmed, you will be refunded on your credit card you used for the payment if it was made via credit card. Timing of refunds may vary depending on the banks\' internal processes and there might be delays. Please follow the process through your bank.&nbsp;In the case of&nbsp;<strong>payment in installments</strong>,&nbsp;refund is also performed in installments due to bank processes.</p>\r\n<ul>\r\n<li><strong><u>I want to return/replace my product. What are the Return/Replacement Terms?</u></strong></li>\r\n</ul>\r\n<p>To submit your product return/replacement requests, please visit our website, www.mallofturkeya.com.tr, and go to \"<strong>Membership/&nbsp;</strong><a href=\"https://www.olegcassini.com.tr/../../../../../customer/account/index/\"><strong>My Account</strong></a><strong>&nbsp;/ Product Return Request\"</strong>&nbsp;for submission of your request or email us at&nbsp;<strong>&nbsp;____@mallofturkeya.com.tr</strong>&nbsp;within&nbsp;<strong>_____days</strong>&nbsp;after you receive the shipped product from courier. You can return your product by submitting the&nbsp;_________.</p>\r\n<p>Please visit our website, www.mallofturkeya.com.tr, go to \"<strong>_________</strong>\" and click &ldquo;<strong>________</strong>&rdquo;&nbsp;from the top left corner to create a product return/replacement request. &nbsp;After selecting the order you want to proceed with, please first click&nbsp;<strong>x</strong>&nbsp;to remove products that you don\'t request any return / replacement and then select relevant items from &ldquo;<strong>package&rdquo; / &ldquo;request type&rdquo; / &ldquo;reason for return</strong>&rdquo;. Please click &ldquo;<strong>Submit request</strong>&rdquo; in the bottom right corner of the page to complete your return/replacement request.</p>\r\n<ul>\r\n<li><strong>Return/Replacement Terms<br /><br /></strong>-Product returns must be in the original box/package together with invoice. <br />-All standard product must be sent intact and undamaged in their original packages.<br />-Any promoted and campaign products given as gifts must also be sent in original packages.<br />-Products cannot be returned if the product is customized by consumer\'s personal needs or special demands, is not suitable for return due to the nature of product, has a perishable nature or may be expired in a short time.<br />-All kinds of Cosmetic and Personal Care Products, as well as any types of Software, Processor (CPU) Program, DVDs, VCDs, CDs and Cassettes, Computer and Stationery Consumable materials (e.g. toners, cartridges, stripes etc.) can only be returned if the original packaging is unopened.<br />-Hygienic products (e.g. underwear), supermarket products (e.g. food products) as well as periodical publications such as newspapers and magazines cannot be returned.<br />-Products valued in stock exchange or other organized markets (gold category) cannot be returned.</li>\r\n</ul>\r\n<p>Please note the abovementioned terms and return the product by specifying the company code_____</p>\r\n<p><u>Sender is responsible for covering the shipment fee for return transactions performed through other courier companies than DHL. </u></p>\r\n<ul>\r\n<li><strong><u>Legal entity refunds:</u></strong></li>\r\n</ul>\r\n<p>If you placed your order on www.mallofturkeya.com.tr as a legal entity and the invoice was issued on behalf of a company, you must issue a \"return invoice\" for your product return r