(611, 1, NULL, 193, 181, 0, 'T-Shirt Bamboo', 't-shirt-bamboo', 'simple', '138', '300.00', '300.00', 611, 'App\\Models\\Product', NULL, NULL, 87, 1, NULL, 'Bamboo T-Shirts\n95% bamboo / 5% spandex\n\n\nBamboo is a fast growing grass that requires no fertilizer and self-regenerates from its own roots. It is naturally smooth without any kind of chemical treatment.\n\nBamboo is naturally hypoallergenic, thermal regulating, incredibly soft, moisture wicking and odor & bacteria resistant.\n\nBamboo gets even softer as you wash it and easy to care for.\n\nWe are convinced that our bamboo t-shirts are the softest and most comfortable shirts on this planet. Once you wear one of our T-shirts you will never want to wear another fabric.\n\n- CARE INSTRUCTIONS: Machine wash in cold water and lay flat to dry, or dry clean. Do not tumble dry. Do not bleach. Iron on low heat.\n\nAvailable in Grey, Black, White, Khaki. S, M, L, XL, XXL.\n\nThank you for visiting our shop !', NULL, NULL, '--istanbul,handicrafts,swawe,women,fashion', '2021-08-30 16:50:47', '2021-08-30 17:01:48', NULL, '2021-08-30 17:01:48', NULL, NULL, NULL),
