(651, 1, NULL, 193, 181, 1, 'T-Shirt Dress', 't-shirt-dress-2', 'simple', '136', '500.00', '500.00', 651, 'App\\Models\\Product', NULL, NULL, 85, 1, NULL, 'T-Shirt Dress\n\n100% HANDCRAFTED!\n\nSport and stylish dress\n\nMODEL INFO: S size, tall 177 cm. She is wearing size S. The design fits true to size.\n\nOur Unique garments are prepared carefully for you.\nOur printed fabrics are made from the highest quality fabric and amazing workmanship!\n\nAvailable in various designs or colors.\n\nFront (100% Cotton).\nBack (100% Polyester) Printed\n\nCARE INSTRUCTIONS: Machine wash in cold water and lay flat to dry, or dry clean. Do not tumble dry. Do not bleach. Iron on low heat.\n\n- CHOOSE THE RIGHT SIZE! We offer you size options, so that you can choose the most suitable one for you.\n\n\nThank you for visiting our shop !', NULL, NULL, '--istanbul,handicrafts,swawe,women,fashion', '2021-08-30 17:06:26', '2021-08-30 17:09:58', NULL, NULL, NULL, NULL, NULL),
