(653, 1, NULL, 193, 181, 1, 'T-Shirt Bamboo', 't-shirt-bamboo-2', 'simple', '138', '300.00', '300.00', 653, 'App\\Models\\Product', NULL, NULL, 87, 1, NULL, 'Bamboo T-Shirts\n95% bamboo / 5% spandex\n\n\nBamboo is a fast growing grass that requires no fertilizer and self-regenerates from its own roots. It is naturally smooth without any kind of chemical treatment.\n\nBamboo is naturally hypoallergenic, thermal regulating, incredibly soft, moisture wicking and odor & bacteria resistant.\n\nBamboo gets even softer as you wash it and easy to care for.\n\nWe are convinced that our bamboo t-shirts are the softest and most comfortable shirts on this planet. Once you wear one of our T-shirts you will never want to wear another fabric.\n\n- CARE INSTRUCTIONS: Machine wash in cold water and lay flat to dry, or dry clean. Do not tumble dry. Do not bleach. Iron on low heat.\n\nAvailable in Grey, Black, White, Khaki. S, M, L, XL, XXL.\n\nThank you for visiting our shop !', NULL, NULL, '--istanbul,handicrafts,swawe,women,fashion', '2021-08-30 17:06:26', '2021-08-30 17:10:08', NULL, NULL, NULL, NULL, NULL),
(654, 1, NULL, 193, 181, 1, 'T-Shirt Bamboo', 't-shirt-bamboo-3', 'simple', '139', '300.00', '300.00', 654, 'App\\Models\\Product', NULL, NULL, 88, 1, NULL, 'Bamboo T-Shirts\n95% bamboo / 5% spandex\n\n\nBamboo is a fast growing grass that requires no fertilizer and self-regenerates from its own roots. It is naturally smooth without any kind of chemical treatment.\n\nBamboo is naturally hypoallergenic, thermal regulating, incredibly soft, moisture wicking and odor & bacteria resistant.\n\nBamboo gets even softer as you wash it and easy to care for.\n\nWe are convinced that our bamboo t-shirts are the softest and most comfortable shirts on this planet. Once you wear one of our T-shirts you will never want to wear another fabric.\n\n- CARE INSTRUCTIONS: Machine wash in cold water and lay flat to dry, or dry clean. Do not tumble dry. Do not bleach. Iron on low heat.\n\nAvailable in Grey, Black, White, Khaki. S, M, L, XL, XXL.\n\nThank you for visiting our shop !', NULL, NULL, '--istanbul,handicrafts,swawe,women,fashion', '2021-08-30 17:06:26', '2021-08-30 17:10:13', NULL, NULL, NULL, NULL, NULL),
(655, 1, NULL, 193, 181, 1, 'Beach Towel', 'beach-towel-3', 'simple', '140', '650.00', '650.00', 655, 'App\\Models\\Product', NULL, NULL, 89, 1, NULL, '100% HANDCRAFTED!\n\n\nOur Unique garments are prepared carefully for you.\nOur printed towels are made from the highest quality fabric and amazing workmanship!\n\nOur Towels will be a nice addition to your wardrobe for Summer.\n\nIt is made from 50% Cotton, 50% Polyester fabric (soft handfeel).\n\nPerfect for the Beach/Pool!\n\nsize: 150 cm diameter.\n\nAvailable in various designs or colors.\n\nModel in the picture wears size S\nModel is 177 cm tall.\n\n\n- CARE INSTRUCTIONS: Machine wash in cold water and lay flat to dry, or dry clean. Do not tumble dry. Do not bleach. Iron on low heat.\n\nThank you for visiting our shop !', NULL, NULL, '--istanbul,handicrafts,swawe,women,fashion', '2021-08-30 17:06:26', '2021-08-30 17:10:19', NULL, NULL, NULL, NULL, NULL),
