(4, 214, 1, 'en', 'Vintage 1950s Soviet Mid-Century Modern Dulevo Orange Polka Dot Tea Serving Set W/ Teapot - 10 Piece Set', '<p>Traditional Soviet era Mid-century modern polka dot pattern in the rare orange color.<br /><br />Bottom marked with a few logos and numbers, perhaps dating this set to 1951.<br /><br />This listing includes 4 saucers, 4 teacups, 1 teapot and 1 teapot li</p>', 'Vintage 1950s Soviet Mid-Century Modern Dulevo Orange', 'Traditional Soviet era Mid-century modern polka dot pattern in the rare orange color.', 'Vintage 1950s', 1, '2021-07-09 19:00:38', '2021-08-27 16:06:01'),
(5, 214, 8, 'ar', 'Vintage 1950s Soviet Mid-Century Modern Dulevo Orange Polka Dot Tea Serving Set W/ Teapot - 10 Piece Set', '<p>Traditional Soviet era Mid-century modern polka dot pattern in the rare orange color.<br /><br />Bottom marked with a few logos and numbers, perhaps dating this set to 1951.<br /><br />This listing includes 4 saucers, 4 teacups, 1 teapot and 1 teapot li</p>', 'Vintage 1950s Soviet Mid-Century Modern Dulevo Orange', 'Traditional Soviet era Mid-century modern polka dot pattern in the rare orange color.', 'Vintage 1950s', 1, '2021-07-09 19:00:38', '2021-08-27 16:06:01'),
(6, 214, 164, 'tr', 'Vintage 1950s Soviet Mid-Century Modern Dulevo Orange Polka Dot Tea Serving Set W/ Teapot - 10 Piece Set', '<p>Traditional Soviet era Mid-century modern polka dot pattern in the rare orange color.<br /><br />Bottom marked with a few logos and numbers, perhaps dating this set to 1951.<br /><br />This listing includes 4 saucers, 4 teacups, 1 teapot and 1 teapot li</p>', 'Vintage 1950s Soviet Mid-Century Modern Dulevo Orange', 'Traditional Soviet era Mid-century modern polka dot pattern in the rare orange color.', 'Vintage 1950s', 1, '2021-07-09 19:00:38', '2021-08-27 16:06:01'),
(7, 215, 1, 'en', 'Vintage Handmade Hand Painted Soviet Bulgarian Red Clay Pottery Tea/Coffee Serving Set - 10 Pieces', '<p>Adorn your home in ethnic style with this Bulgarian Pottery Set with Hand-Painted Decoration.<br />This tea or coffee set is handmade in Bulgaria.<br />The set consists of 4 cups, 4 Saucers, a dessert plate (can also be hung on wall) and a tea or coffee pot.<br />These pieces were thrown by hand on the potters wheel and hand-painted in traditional Bulgarian motives. They were double baked and glazed inside and outside.</p>', 'Vintage Handmade', 'Adorn your home in ethnic style with this Bulgarian Pottery Set with Hand-Painted Decoration. This tea or coffee set is handmade in Bulgaria.', 'Vintage Handmade', 1, '2021-07-09 19:18:21', '2021-08-11 15:06:55'),
(8, 215, 8, 'ar', 'Vintage Handmade Hand Painted Soviet Bulgarian Red Clay Pottery Tea/Coffee Serving Set - 10 Pieces', '<p>Adorn your home in ethnic style with this Bulgarian Pottery Set with Hand-Painted Decoration.<br />This tea or coffee set is handmade in Bulgaria.<br />The set consists of 4 cups, 4 Saucers, a dessert plate (can also be hung on wall) and a tea or coffee pot.<br />These pieces were thrown by hand on the potters wheel and hand-painted in traditional Bulgarian motives. They were double baked and glazed inside and outside.</p>', 'Vintage Handmade', 'Adorn your home in ethnic style with this Bulgarian Pottery Set with Hand-Painted Decoration. This tea or coffee set is handmade in Bulgaria.', 'Vintage Handmade', 1, '2021-07-09 19:18:21', '2021-08-11 15:06:55'),
(9, 215, 164, 'tr', 'Vintage Handmade Hand Painted Soviet Bulgarian Red Clay Pottery Tea/Coffee Serving Set - 10 Pieces', '<p>Adorn your home in ethnic style with this Bulgarian Pottery Set with Hand-Painted Decoration.<br />This tea or coffee set is handmade in Bulgaria.<br />The set consists of 4 cups, 4 Saucers, a dessert plate (can also be hung on wall) and a tea or coffee pot.<br />These pieces were thrown by hand on the potters wheel and hand-painted in traditional Bulgarian motives. They were double baked and glazed inside and outside.</p>', 'Vintage Handmade', 'Adorn your home in ethnic style with this Bulgarian Pottery Set with Hand-Painted Decoration. This tea or coffee set is handmade in Bulgaria.', 'Vintage Handmade', 1, '2021-07-09 19:18:21', '2021-08-11 15:06:55'),
(10, 216, 1, 'en', 'MEC Duffle Bag', '<p>Built for the long haul, MEC&rsquo;s duffel bags are the perfect place to park all that stuff you take out of your pack to make it lighter at the trailhead. These rugged bags are at home sliding along airport conveyor belts and sitting on top of yaks, too!</p>\r\n<ul>\r\n<li>Made of 370g 1000-denier nylon, reinforced with extra-wide 7.5cm webbing.</li>\r\n<li>Durable full-length #10 YKK&reg; zipper on top of bag.</li>\r\n<li>Contoured shape and side-zip pocket.</li>\r\n<li>Heavy-duty D-rings accommodate a shoulder strap (included).</li>\r\n<li>Side-grip trunk handles for convenience.</li>\r\n</ul>', 'MEC Duffle Bag', 'Built for the long haul, MEC’s duffel bags are the perfect place to park all that stuff you take out of your pack to make it lighter at the trailhead. These rugged bags are at home sliding along airport conveyor belts and sitting on top of yaks, too!', 'MEC Duffle Bag', 1, '2021-07-09 19:31:34', '2021-08-02 13:32:05'),
(11, 216, 8, 'ar', 'حقيبة دافل إم إي سي', '<p>صُممت الحقائب القماشية من MEC المصممة للمسافات الطويلة ، وهي المكان المثالي لإيقاف كل الأشياء التي تخرجها من حقيبتك لجعلها أخف في الطريق. هذه الحقائب الوعرة في المنزل تنزلق على طول أحزمة النقل بالمطار وتجلس فوق الياك أيضًا!</p>\r\n<p>مصنوع من نايلون 370 جرام 1000 دينير ، مقوى بحزام بعرض 7.5 سم.<br />طول كامل متين # 10 YKK&reg; سحاب أعلى الكيس.<br />شكل محيطي وجيب بسحاب جانبي.<br />تستوعب حلقات D شديدة التحمل حزام كتف (مضمّن).<br />مقابض جانبية للصندوق للراحة.</p>', 'MEC Duffle Bag', 'صُممت الحقائب القماشية من MEC المصممة للمسافات الطويلة ، وهي المكان المثالي لإيقاف كل الأشياء التي تخرجها من حقيبتك لجعلها أخف في الطريق. هذه الحقائب الوعرة في المنزل تنزلق على طول أحزمة النقل بالمطار وتجلس فوق الياك أيضًا!', 'MEC Duffle Bag', 1, '2021-07-09 19:31:34', '2021-08-02 13:32:05'),
(12, 216, 164, 'tr', 'MEC Spor Çantası', '<p>Built for the long haul, MEC&rsquo;s duffel bags are the perfect place to park all that stuff you take out of your pack to make it lighter at the trailhead. These rugged bags are at home sliding along airport conveyor belts and sitting on top of yaks, too!</p>\r\n<ul>\r\n<li>Made of 370g 1000-denier nylon, reinforced with extra-wide 7.5cm webbing.</li>\r\n<li>Durable full-length #10 YKK&reg; zipper on top of bag.</li>\r\n<li>Contoured shape and side-zip pocket.</li>\r\n<li>Heavy-duty D-rings accommodate a shoulder strap (included).</li>\r\n<li>Side-grip trunk handles for convenience.</li>\r\n</ul>', 'MEC Duffle Bag', 'Built for the long haul, MEC’s duffel bags are the perfect place to park all that stuff you take out of your pack to make it lighter at the trailhead. These rugged bags are at home sliding along airport conveyor belts and sitting on top of yaks, too!', 'MEC Duffle Bag', 1, '2021-07-09 19:31:34', '2021-08-02 13:32:05'),
(13, 217, 1, 'en', 'Team Refuse Jacket', '<p>Dombai Sport Jackets features full coverage graphics on our premium, soft-to-touch&nbsp;fabric. Comprised of 100% Polyester, this jacket provides the perfect blend of warmth and comfort, offers excellent thermal properties, is light, comfortable and dries quickly even during use.&nbsp;All Dombai Sport&nbsp;Custom Gaming Jackets are manufactured in Europe and can be shipped worldwide.&nbsp;</p>', 'Team Refuse Jacket', 'Dombai Sport Jackets features full coverage graphics on our premium, soft-to-touch fabric. Comprised of 100% Polyester, this jacket provides the perfect blend of warmth and comfort, offers excellent thermal properties, is light, comfortable and dries quickly even during use. All Dombai Sport Custom Gaming Jackets are manufactured in Europe and can be shipped worldwide. ', 'Team Refuse Jacket', 1, '2021-07-09 19:40:11', '2021-07-13 18:20:27'),
