(160, 259, 1, 'en', NULL, '<div id=\"tw-target-text-container\" class=\"tw-ta-container F0azHf tw-nfl\" tabindex=\"0\">\r\n<div id=\"tw-target-text-container\" class=\"tw-ta-container F0azHf tw-nfl\" tabindex=\"0\">\r\n<p>&nbsp;</p>\r\n<div class=\"entry-content\">\r\n<p>Arabic Lorem Ipsum is the Arabic form of the latin text that is typically used by designers and developers as dummy text. This Arabic dummy text is used for various designs, webpages, brochures, and many other projects where temporary&nbsp;content is needed to fill a space before the desired content for that space is available.</p>\r\n</div>\r\n</div>\r\n</div>', 'shoes', 'adcaevbebvfeqb', 'qebgqergtbergb', 1, '2021-07-19 10:35:12', '2021-08-04 10:22:31'),
(161, 259, 8, 'ar', 'احذية بيضاء', '<div id=\"tw-target-text-container\" class=\"tw-ta-container F0azHf tw-lfl\" tabindex=\"0\">\r\n<div id=\"tw-target-text-container\" class=\"tw-ta-container F0azHf tw-lfl\" tabindex=\"0\">\r\n<p>لكن لا بد أن أوضح لك أن كل هذه الأفكار المغلوطة حول استنكار &nbsp;النشوة وتمجيد الألم نشأت بالفعل، وسأعرض لك التفاصيل لتكتشف حقيقة وأساس تلك السعادة البشرية، فلا أحد يرفض أو يكره أو يتجنب الشعور بالسعادة، ولكن بفضل هؤلاء الأشخاص الذين لا يدركون بأن السعادة لا بد أن نستشعرها بصورة أكثر عقلانية ومنطقية فيعرضهم هذا لمواجهة الظروف الأليمة، وأكرر بأنه لا يوجد من يرغب في الحب ونيل المنال ويتلذذ بالآلام، الألم هو الألم ولكن نتيجة لظروف ما قد تكمن السعاده فيما نتحمله من كد وأسي.</p>\r\n<p>و سأعرض مثال حي لهذا، من منا لم يتحمل جهد بدني شاق إلا من أجل الحصول على ميزة أو فائدة؟ ولكن من لديه الحق أن ينتقد شخص ما أراد أن يشعر بالسعادة التي لا تشوبها عواقب أليمة أو آخر أراد أن يتجنب الألم الذي ربما تنجم عنه بعض المتعة ؟&nbsp;<br />علي الجانب الآخر نشجب ونستنكر هؤلاء الرجال المفتونون بنشوة اللحظة الهائمون في رغباتهم فلا يدركون ما يعقبها من الألم والأسي المحتم، واللوم كذلك يشمل هؤلاء الذين أخفقوا في واجباتهم نتيجة لضعف إرادتهم فيتساوي مع هؤلاء الذين يتجنبون وينأون عن تحمل الكدح والألم .<br />&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n</div>\r\n<div id=\"tw-target-rmn-container\" class=\"tw-target-rmn tw-ta-container F0azHf tw-nfl\"></div>\r\n</div>\r\n<div id=\"tw-target-rmn-container\" class=\"tw-target-rmn tw-ta-container F0azHf tw-nfl\"></div>', 'wrenbwrn', 'etbrwerwgtbrw', 'rgnbwrnwr', 1, '2021-07-19 10:35:12', '2021-08-04 10:22:31'),
