(2, 142, 1, '60c9db11c711d_FARIYA_MOBILE.png', NULL, '<p>Fraiya Group operates <a title=\"E-commerce\" href=\"https://en.wikipedia.org/wiki/E-commerce\">e-commerce</a>&nbsp;platforms and logistics service in&nbsp;<a title=\"Bangladesh\" href=\"https://en.wikipedia.org/wiki/Bangladesh\">Bangladesh</a>,&nbsp;<a title=\"Myanmar\" href=\"https://en.wikipedia.org/wiki/Myanmar\">Myanmar</a>,&nbsp;<a title=\"Nepal\" href=\"https://en.wikipedia.org/wiki/Nepal\">Nepal</a>,&nbsp;<a title=\"\" href=\"https://en.wikipedia.org/wiki/Pakistan\">Pakistan</a>&nbsp;and&nbsp;<a title=\"Sri Lanka\" href=\"https://en.wikipedia.org/wiki/Sri_Lanka\">Sri Lanka</a>.<sup id=\"cite_ref-Gigabit_1-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Daraz#cite_note-Gigabit-1\">[1]</a></sup> Bjarke Mikkelsen is the current CEO of Fariya.<sup id=\"cite_ref-Business_Chief_Asia_2-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Daraz#cite_note-Business_Chief_Asia-2\">[2]</a></sup><sup id=\"cite_ref-Bloomberg_News_3-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Daraz#cite_note-Bloomberg_News-3\">[3]</a></sup> In May 2018,&nbsp;<a class=\"new\" title=\"Daraz Group (page does not exist)\" href=\"https://en.wikipedia.org/w/index.php?title=Daraz_Group&amp;action=edit&amp;redlink=1\">Fariya Group</a>&nbsp;was acquired by the Chinese&nbsp;<a title=\"E-commerce\" href=\"https://en.wikipedia.org/wiki/E-commerce\">e-commerce</a>&nbsp;company&nbsp;<a title=\"Alibaba Group\" href=\"https://en.wikipedia.org/wiki/Alibaba_Group\">Alibaba Group</a>&nbsp;from Rocket Internet.</p>', '<p>Fariya is an <a title=\"Online marketplace\" href=\"https://en.wikipedia.org/wiki/Online_marketplace\">online marketplace</a>&nbsp;and logistics company which operates in markets of&nbsp;<a title=\"South Asia\" href=\"https://en.wikipedia.org/wiki/South_Asia\">South Asia</a>&nbsp;and&nbsp;<a title=\"Southeast Asia\" href=\"https://en.wikipedia.org/wiki/Southeast_Asia\">Southeast Asia</a>. I