(1, 142, 1, 'en', 'Fariya Mobile Mall', '<p>Fraiya Group operates e-commerce platforms and logistics service in Turkey. Bjarke Mikkelsen is the current CEO of Fariya. <sup id=\"cite_ref-Business_Chief_Asia_2-0\" class=\"reference\"></sup><sup id=\"cite_ref-Bloomberg_News_3-0\" class=\"reference\"></sup>In May 2018, Fariya was acquired by the Chinese e-commerce company Ali Baba from Rocket Internet.</p>', NULL, '<p>Fariya is an online market-place and logistics company which operates in markets of Turkey. It was founded in 2012 as an online fashion e-commerce marketplace in Pakistan by Muneeb Maayr (Founder) &amp; Farees Shah (Co-Founder) at the based venture builder,&nbsp;Fraiya Group operates e-commerce platforms and logistics service in Turkey. Bjarke Mikkelsen is the current CEO of Fariya. <sup id=\"cite_ref-Business_Chief_Asia_2-0\" class=\"reference\"></sup><sup id=\"cite_ref-Bloomberg_News_3-0\" class=\"reference\"></sup>In May 2018, Fariya was acquired by the Chinese e-commerce company Ali Baba from Rocket Internet. bv nvhjh</p>', 1, '2021-07-17 17:33:00', '2021-08-02 13:34:51'),
(2, 142, 8, 'ar', 'فاريا موبايل مول', '<div id=\"tw-target-text-container\" class=\"tw-ta-container F0azHf tw-lfl\" tabindex=\"0\">\r\n<pre id=\"tw-target-text\" class=\"tw-data-text tw-text-large XcVN5d tw-ta\" dir=\"rtl\" data-placeholder=\"Translation\"><span class=\"Y2IQFc\" lang=\"ar\">تدير Fraiya Group منصات التجارة الإلكترونية والخدمات اللوجستية في تركيا. Bjarke Mikkelsen هو الرئيس التنفيذي الحالي لشركة Fariya. في مايو 2018 ، استحوذت شركة التجارة الإلكترونية الصينية علي بابا على Fariya من Rocket Internet.</span></pre>\r\n</div>\r\n<div id=\"tw-target-rmn-container\" class=\"tw-target-rmn tw-ta-container F0azHf tw-nfl\"></div>', NULL, '<p>Fariya is an online market-place and logistics company which operates in markets of Turkey. It was founded in 2012 as an online fashion e-commerce marketplace in Pakistan by Muneeb Maayr (Founder) &amp; Farees Shah (Co-Founder) at the based venture builder,&nbsp;Fraiya Group operates e-commerce platforms and logistics service in Turkey. Bjarke Mikkelsen is the current CEO of Fariya. <sup id=\"cite_ref-Business_Chief_Asia_2-0\" class=\"reference\"></sup><sup id=\"cite_ref-Bloomberg_News_3-0\" class=\"reference\"></sup>In May 2018, Fariya was acquired by the Chinese e-commerce company Ali Baba from Rocket Internet. bv nvhjh</p>', 1, '2021-07-17 17:33:00', '2021-08-02 13:34:51'),
(3, 142, 164, 'tr', 'Fariya Mobile Mall', '<p>Fraiya Group operates e-commerce platforms and logistics service in Turkey. Bjarke Mikkelsen is the current CEO of Fariya. <sup id=\"cite_ref-Business_Chief_Asia_2-0\" class=\"reference\"></sup><sup id=\"cite_ref-Bloomberg_News_3-0\" class=\"reference\"></sup>In May 2018, Fariya was acquired by the Chinese e-commerce company Ali Baba from Rocket Internet.</p>', NULL, '<p>Fariya is an online market-place and logistics company which operates in markets of Turkey. It was founded in 2012 as an online fashion e-commerce marketplace in Pakistan by Muneeb Maayr (Founder) &amp; Farees Shah (Co-Founder) at the based venture builder,&nbsp;Fraiya Group operates e-commerce platforms and logistics service in Turkey. Bjarke Mikkelsen is the current CEO of Fariya. <sup id=\"cite_ref-Business_Chief_Asia_2-0\" class=\"reference\"></sup><sup id=\"cite_ref-Bloomberg_News_3-0\" class=\"reference\"></sup>In May 2018, Fariya was acquired by the Chinese e-commerce company Ali Baba from Rocket Internet. bv nvhjh</p>', 1, '2021-07-17 17:33:00', '2021-08-02 13:34:51'),
